import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 700px;
  background: #ffffff;
  h3 {
    position: absolute;
    width: 665px;
    height: 48px;
    left: 291px;
    top: 2016px;

    font-family: Poppins;
    font-style: normal;
    font-weight: 600;
    font-size: 32px;
    line-height: 48px;
    /* identical to box height */

    text-align: center;

    color: #000000;
  }
`;
